    false,nt"url": null,nt"notes": "A preliminary study of the nesting ecology
    of Emperor Geese (Philacte canacica), in the Kokechik Bay region of Alaska, during
    the summer of 1971, is reported here. The weather, vegetation, and fauna of the
    area are described. The following factors in the nesting ecology of Emperor Geese
    are discussed: productivity, nest initiation, incubation, mortality, nesting characteristics,
    interspecific relationships, and some behavioral aspects.",nt"license_title":
